import styles from './LandingPage.module.css';

export default function InfoCard(props) {
  return (
    <div className={styles.info_wrapper}>
      <div className={styles.info_header}>Hello. I’m Jane.</div>
      <div className={styles.info_paragraph}>I’m a Creative Technologist based in New York.</div>
    </div>
  );
}
